import React, { FC } from 'react'
import { Row, Col, Image } from "antd";
import introImage from '../../../assets/images/intro.jpeg'

interface Props {

}

const Intro: React.FC = () => {
    return (
        <div>
            <Row gutter={16}>
                <Col span={12}>
                    <Image
                        width={200}
                        src={introImage}
                    />col-12</Col>
                <Col span={12}>
                    <h5>안녕하세요 <strong>개발자 이동영</strong> 입니다.</h5>
                    col-12</Col>
            </Row>
        </div>
    )
}

export default Intro;
